import './App.css';


const toDoList = ['correr', 'meditar', 'tomar café', 'estudar'];

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

function App() {
  return (
    <div className="App">
      {Task(toDoList)}
    </div>
  );
}

export default App;
